import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, useLocation, useNavigate } from 'react-router-dom';
import './App.css';
import HomePage from './pages/HomePage';
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';
import ProfilePage from './pages/ProfilePage';
import EventDetailsPage from './pages/EventDetailsPage';
import CheckoutPage from './pages/CheckoutPage';
import PaymentConfirmationPage from './pages/PaymentConfirmationPage';
import MyTicketsPage from './pages/MyTicketsPage';
import TradingPage from './pages/TradingPage';
import CancellationSuccessPage from './pages/CancellationSuccessPage';
import TradeSuccessPage from './pages/TradeSuccessPage';
import DebugPage from './pages/DebugPage';
import Navbar from './components/Navbar';
import ProtectedRoute from './components/ProtectedRoute';
import { AuthProvider, useAuth } from './context/AuthContext';

// Splash screen component
function SplashScreen() {
  return (
    <div className="splash-screen">
      <div className="splash-content">
        <h1>TicketMaster</h1>
        <div className="splash-loading">Loading...</div>
      </div>
    </div>
  );
}

// Component to check authentication on every navigation
function AuthCheck({ children }) {
  const location = useLocation();
  const { checkAuthState, loading } = useAuth();
  const [isChecking, setIsChecking] = useState(true);

  useEffect(() => {
    console.log("AuthCheck running on path:", location.pathname);

    const verifyAuth = async () => {
      setIsChecking(true);
      try {
        await checkAuthState();
        console.log("Auth state verified");
      } catch (err) {
        console.error("Error verifying auth state:", err);
      } finally {
        setIsChecking(false);
      }
    };

    verifyAuth();
  }, [location.pathname, checkAuthState]);

  if (loading || isChecking) {
    return <SplashScreen />;
  }

  return children;
}

// Component containing all the routes
function AppRoutes() {
  const { isAuthenticated, user } = useAuth();

  // Log auth status when it changes
  useEffect(() => {
    console.log("Auth status in AppRoutes:", { isAuthenticated, user: user?.email });
  }, [isAuthenticated, user]);

  return (
    <>
      <Navbar />
      <Routes>
        {/* Public routes */}
        <Route path="/login" element={<LoginPage />} />
        <Route path="/register" element={<RegisterPage />} />
        <Route path="/debug" element={<DebugPage />} />

        {/* Protected routes */}
        <Route 
          path="/" 
          element={
            <ProtectedRoute>
              <HomePage />
            </ProtectedRoute>
          } 
        />
        <Route 
          path="/event/:id" 
          element={
            <ProtectedRoute>
              <EventDetailsPage />
            </ProtectedRoute>
          } 
        />
        <Route 
          path="/checkout" 
          element={
            <ProtectedRoute>
              <CheckoutPage />
            </ProtectedRoute>
          } 
        />
        <Route 
          path="/payment-confirmation" 
          element={
            <ProtectedRoute>
              <PaymentConfirmationPage />
            </ProtectedRoute>
          } 
        />
        <Route 
          path="/trading" 
          element={
            <ProtectedRoute>
              <TradingPage />
            </ProtectedRoute>
          } 
        />
        <Route 
          path="/my-tickets" 
          element={
            <ProtectedRoute>
              <MyTicketsPage />
            </ProtectedRoute>
          } 
        />
        <Route 
          path="/profile" 
          element={
            <ProtectedRoute>
              <ProfilePage />
            </ProtectedRoute>
          } 
        />
        <Route 
          path="/cancellation-success" 
          element={
            <ProtectedRoute>
              <CancellationSuccessPage />
            </ProtectedRoute>
          } 
        />
        <Route 
          path="/trade-success" 
          element={
            <ProtectedRoute>
              <TradeSuccessPage />
            </ProtectedRoute>
          } 
        />

        {/* Catch all - redirect to home */}
        <Route path="*" element={<Navigate to="/" replace />} />
      </Routes>
    </>
  );
}

function App() {
  useEffect(() => {
    // Force dark mode
    document.documentElement.classList.add('dark');
  }, []);

  return (
    <AuthProvider>
      <Router>
        <AuthCheck>
          <AppRoutes />
        </AuthCheck>
      </Router>
    </AuthProvider>
  );
}

export default App;
